商品名：クレハ　キチントさん　レンジ対応保存容器　オレンジ　Ｍ　４個<br>内容量：4個<br>ブランド：キチントさん<br>原産国：日本<br><br>ＨＡＰＰＹ　ＯＲＥＮＧＥ　台所をもっと楽しく元気に<br>キチントさん「レンジ対応保存容器」はフタごと冷凍⇔電子レンジ加熱できる、軽くて丈夫な保存容器です。電子レンジ（１４０℃）フリーザー（－２０℃）フタごとチン！蒸気弁を開けて加熱してください。食欲を増進し、陽気な気分にさせてくれるオレンジをメインカラーに展開。統一色にすることで、店頭でのブランドイメージがわかりやすく、目立ちも向上します。<br>問合せ先：株式会社クレハお客様相談室　〒１０３－８５５２　東京都中央区日本橋浜町３－３－２　ＴＥＬ０１２０－０３－９０８０　９：００－１２：００、１２：４５－１７：３０（土曜、日曜、祝日除く）<br><br>JANコード：4901422338848<br><br><br>商品番号：101-62950<br><br><br><br>区分： 容器・ストッカー・調味料容器 <br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
